  let n = grid.length
  let m = grid[0].length
  let dp = new Array(n).fill(1).map(() => new Array(m).fill(0))
  dp[0][0] = grid[0][0]

  for (let i = 1; i < n; i++) {
    dp[i][0] = dp[i - 1][0] + grid[i][0]
  }

  for (let j = 1; j < m; j++) {
    dp[0][j] = dp[0][j - 1] + grid[0][j]
  }

  for (let i = 1; i < n; i++) {
    for (let j = 1; j < m; j++) {
      dp[i][j] = Math.min(dp[i][j - 1], dp[i - 1][j]) + grid[i][j]
    }
  }

  return dp[n - 1][m - 1]
}

