 * @param {character[][]} board
 * @return {boolean}
 */
var isValidSudoku = function(board) {
  let n = board.length
  let m = board[0].length

  let hashSet = new Set()

  for (let i = 0; i < n; i++) {
    for (let j = 0; j < m; j++) {
      let char = board[i][j]
      if (char !== '.') {
        let blockI = Math.floor(i / 3)
        let blockJ = Math.floor(j / 3)
        let rTag = 'r' + i + char
        let cTag = 'c' + j + char
        let bTag = 'b' + blockI + '+' + blockJ + char
        if (hashSet.has(rTag) || hashSet.has(cTag) || hashSet.has(bTag)) {
          return false
        } else {
          hashSet.add(rTag)
          hashSet.add(cTag)
          hashSet.add(bTag)
        }
      }
    }
  }

  return true
}

