var trap = function(height) {
  let n = height.length
  let maxWater = 0

  let leftMaxValues = [0]
  let leftMaxValue = height[0]
  for (let i = 1; i < n; i++) {
    leftMaxValues[i] = leftMaxValue
    if (height[i] > leftMaxValue) leftMaxValue = height[i]
  }

  let rightMaxValues = []
  rightMaxValues[n - 1] = 0
  let rightMaxValue = height[n - 1]
  for (let i = n - 2; i >= 0; i--) {
    rightMaxValues[i] = rightMaxValue
    if (height[i] > rightMaxValue) rightMaxValue = height[i]
  }

  for (let i = 1; i < n - 1; i++) {
    if (leftMaxValues[i] > height[i] && rightMaxValues[i] > height[i]) {
      maxWater += Math.min(
        leftMaxValues[i] - height[i],
        rightMaxValues[i] - height[i]
      )
    }
  }

  return maxWater
}

