var trap = function(height) {
  let n = height.length
  let maxHeight = Math.max(...height)
  let maxWater = 0
  let cacheMap = {}

  for (let h = 0; h < maxHeight; h++) {
    for (let i = 1; i < n; i++) {
      if (height[i] <= h) {
        // empty
        let leftRightHasBlock = false
        if (cacheMap[`${h}_${i - 1}`] === true) {
          leftRightHasBlock = true
        } else {
          let left = i - 1
          let right = i + 1
          while (left >= 0 && right < n) {
            if (height[left] > h && height[right] > h) {
              leftRightHasBlock = true
              break
            }
            if (height[left] <= h) {
              left--
            }
            if (height[right] <= h) {
              right++
            }
          }
        }

        if (leftRightHasBlock) {
          cacheMap[`${h}_${i}`] = true
          maxWater++
        }
      }
    }
  }

  return maxWater
}

