  let low = 0
  let high = nums.length - 1

  while(low <= high){
      let mid = Math.floor(low + (high - low) / 2)

      if(nums[mid] === target) return mid

      if(nums[low] <= mid){ // left sorted
          if(target >= nums[low] && target < nums[mid]) {
              high = mid - 1 
          }else {
              low = mid + 1
          }
      }else { // right sorted
          if(target <= nums[high] && target > nums[mid]) {
              low = mid + 1
          }else {
              high = mid - 1
          }
      }
  }

  return -1;
};

