            return true;
        }

        stack<int> s;
        s.push(head->val);
        ListNode *fast = head, *slow = head;

        while(slow->next && fast->next && fast->next->next){
            slow = slow->next;
            fast = fast->next->next;
            s.push(slow->val);
        }

        if (!fast->next) {
            s.pop();
        }

        while(slow->next) {
            slow = slow->next;
            int tmp = s.top();
            s.pop();
            if (slow->val != tmp){
                return false;
            }
        }

        return true;
    }
};

